/*Table structure for table `submit_manuscript` */

DROP TABLE IF EXISTS `submit_manuscript`;

CREATE TABLE `submit_manuscript` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) DEFAULT NULL COMMENT '标题',
  `submission_unit` varchar(100) DEFAULT NULL COMMENT '投稿单位',
  `submission_unit_id` varchar(50) DEFAULT NULL COMMENT '投稿单位标识',
  `adoption` int(11) DEFAULT NULL COMMENT '公司采用',
  `contribution_date` date DEFAULT NULL COMMENT '投稿时间',
  `category_id` int(11) DEFAULT NULL COMMENT '信息类别标识',
  `type` varchar(50) DEFAULT NULL COMMENT '分类',
  `contributor` varchar(50) DEFAULT NULL COMMENT '投稿人',
  `user_account` varchar(50) DEFAULT NULL COMMENT '投稿人账号',
  `mobile_phone` varchar(32) DEFAULT NULL COMMENT '投稿人联系方式',
  `is_reported` varchar(1) DEFAULT NULL COMMENT '是否上报部委',
  `issuer` varchar(50) DEFAULT NULL COMMENT '签发人',
  `issuer_user_account` varchar(50) DEFAULT NULL COMMENT '签发人账号',
  `issuer_mobile_phone` varchar(50) DEFAULT NULL COMMENT '签发人联系方式',
  `issuer_time` datetime DEFAULT NULL COMMENT '签发时间',
  `manuscript_status` varchar(100) DEFAULT NULL COMMENT '稿件状态',
  `document` varchar(500) DEFAULT NULL,
  `create_time` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `update_time` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `tenant_info_id` varchar(10) DEFAULT NULL,
  `next_users` varchar(256) DEFAULT NULL COMMENT '下一个步人员',
  `is_extra` varchar(1) DEFAULT '0',
  `is_red_file` varchar(1) DEFAULT '0',
  `is_multiple_adopt` varchar(1) DEFAULT '0',
  `by_multiple_adopt` varchar(1) DEFAULT '0',
  `multiple_adopt_ids` varchar(64) DEFAULT NULL,
  `take_back_user_account` varchar(64) DEFAULT NULL,
  `proc_inst_id` varchar(32) DEFAULT NULL,
  `proc_start_time` bigint(20) DEFAULT NULL COMMENT '流程开始时间',
  `proc_end_time` bigint(20) DEFAULT NULL COMMENT '流程结束时间',
  `proc_startor` varchar(32) DEFAULT NULL,
  `template_id` varchar(16) DEFAULT NULL,
  `pre_proc_user_account` varchar(32) DEFAULT NULL,
  `pre_proc_time` date DEFAULT NULL,
  `is_owner` varchar(1) DEFAULT '1',
  `communal_id` bigint(20) DEFAULT NULL,
  `next_manuscript_id` bigint(20) DEFAULT NULL,
  `is_before_edit` varchar(1) DEFAULT '0',
  `is_restricted` int(1) DEFAULT NULL COMMENT '是否生成内部参考,0代表生成0篇，1代表生成1篇',
  `dept_id` varchar(32) DEFAULT NULL,
  `is_next_read` varchar(1) DEFAULT '0',
  `org_id` varchar(64) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `fk_category_id` (`category_id`) USING BTREE,
  CONSTRAINT `submit_manuscript_ibfk_1` FOREIGN KEY (`category_id`) REFERENCES `submit_category` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=561 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

